import React from "react"

const TodoList = props => (
  <div>
    {props.todoList.length <= 1
      ? `${props.todoList.length} thing to do`
      : `${props.todoList.length} things to do`}
    <ul>
      {props.todoList.map(todoItem => (
        <li>{todoItem}</li>
      ))}
    </ul>
  </div>
)

export default TodoList
